import styled from 'styled-components';
import { Link as LinkRouter } from 'react-router-dom';

export const Container = styled.div`
    margin-top: 130px;
    height: 120vh;
    width: 100vw;
    background: green;
    border-bottom: .5px solid #403F3F;
`

export const Project = styled.div`
    position: fixed;
    width: 60%;
    height: 60%;
    left 20%;
    top: 20%;
    background: pink;
`
